  let arr = [1, 3, 4, 2];
  const oepnEvent = () => {
    setoepn((pre) => !pre);
  };
  return (
    <div className="box">
      <button onClick={oepnEvent}>open</button>
      {open && (
        <div className="ctn">
          {arr.map((a, i) => (
            <div className="box" key={i}></div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Index;
